// AnimatedWrapper.js
import React from 'react';
import { Fade } from '@mui/material';

const AnimatedWrapper = ({ children }) => {
  return (
    <Fade in={true} timeout={1000}>
      <div>{children}</div>
    </Fade>
  );
};

export default AnimatedWrapper;
